import React from 'react';
import s from './Header.module.css';
import {NavLink} from "react-router-dom";

const Header = (props) => {
    return <header className={s.header}>
        <img src='https://png2.cleanpng.com/sh/2d03f3a3feeeb0a1f960ec48a3a4bfec/L0KzQYm3V8A2N5hqf5H0aYP2gLBuTfxwb5Cye9H3Y3XzhH7ohP1qepJxRdR7b3BufMr1Tf5qdpZzgdDuLYPoccT2jr02NWZnS9ZvY0m3doS4VPY5NmI9Uac6MkG7QYa6UMc5QWE2SqsENUexgLBu/kisspng-logo-concept-admiral-brooklyn-ninenine-season-5-5b3dfc94f314f8.1895121815307890129957.png' />

        <div className={s.loginBlock}>
            { props.isAuth
                ? <div>{props.login} - <button onClick={props.logout}>Log out</button> </div>
                : <NavLink to={'/login'}>Login</NavLink> }
        </div>
    </header>
}

export default Header;
